import React from "react";
import ButtonGroup from "react-bootstrap/ButtonGroup";
import Button from "react-bootstrap/Button";
function Buttons() {
    return <>
        <ButtonGroup size="lg">
            <Button>1</Button>
            <Button>2</Button>
            <Button>3</Button>
            <Button>4</Button>
        </ButtonGroup>
    </>
}
export default Buttons;
